import '../assets/css/App.css';
import React, { useState } from 'react';
import ButtonList from './ButtonList';
import SelectedNumList from './SelectedNumList';
import PriceList from './PriceList';
import TotalPrice from './totalPrice';

function HomePage(props) {
    return (
        <div className="styleclass">
            <div>
                <div><ButtonList Ifnum={props.Ifnum} num={props.num} Clear={props.Clear} /></div>
                <div><SelectedNumList num={props.num}/></div>
            </div>
            <div></div>
            <div>
                <div><PriceList totalPrice={props.totalPrice}/></div>
                <div><TotalPrice totalPrice={props.totalPrice} dollar={props.dollar}/></div>
            </div>
        </div>
    );
}

export default HomePage;
